import React from 'react';
import Container from '../components/container';
import { Input, Form } from '../components/uiComponent';

const Upload = () => {
  return (
    <Container flexDirection="column">
      <div>미리보기 이미지</div>
      <Form>
        
        <Input type="file" />

        <Input type="text" />
        <Input type="text" />
        <textarea></textarea>
      </Form>
    </Container>
  );
};

export default Upload;
